    Taiko check function.
    Return values:
            1- Blue Taiko
            2- Red Taiko
    -----------------------------------------
    */
    int CheckColour(DWORD Colour)
    {
            //Get pixel colour elements
            BYTE r = GetRValue(Colour);
            BYTE g = GetGValue(Colour);
            BYTE b = GetBValue(Colour);

            //Low red, medium green, high blue
            if(r<=85 && (g>85 && g<170) && b>170)
            {
                    return 1; //Blue taiko
            }

            //High red, low green, low blue
            if(r>170 && g<=85 && b<=85)
            {
                    return 2; //Red taiko
            }
    }

