    /*
    ------------------------------------
    Main bot thread. Checks the pixels
    for the taiko colours and presses
    the corresponding keys.
    ------------------------------------
    */
    void Bot(HWND hDlg)
    {
            DWORD clr;
            HWND CurWnd;
            HDC CurDC;

            while(1) //Loop indefinitely
            {
                    if(IsOn)
                    {
                            //Get desktop DC
                            hDC = GetWindowDC(0);
                            for(int i=0; i<6; i++)
                            {
                                    //Check the pixel i in the row.
                                    clr = GetPixel(hDC, (CheckPos.x)+i, CheckPos.y); //Check a row of 6 pixels horizontally

                                    //Blue taiko check
                                    if(CheckColour(clr) == 1)
                                    {
                                            //Press C
                                            keybd_event(0x56, 0, 0, 0);
                                            Sleep(40); //Tweak with this for better performance.
                                            keybd_event(0x56, 0, 0x2, 0);
                                    }

                                    //Red taiko check
                                    if(CheckColour(clr) == 2)
                                    {
                                            //Press V
                                            keybd_event(0x43, 0, 0, 0);    
                                            Sleep(40);      //Tweak with this for better performance.
                                            keybd_event(0x43, 0, 0x2, 0);
                                    }
                            }
                            //Release desktop DC
                            ReleaseDC(0, hDC);
                    }
                    //Tweak with this for better performance.
                    Sleep(7);
            }
    }

    /*
    ------------------------------------
    Hotkey check thread. Checks for
    hotkeys made for use in-game.
    ------------------------------------
    */
    void Hotkeys(HWND hDlg)
    {      
            while(1)
            {
                    if(GetAsyncKeyState(VK_CONTROL)) //Position setting hotkey
                    {
                            GetCursorPos(&CheckPos);
                            sprintf(szBuffer, "%i", CheckPos.x);
                            SetDlgItemTextA(hDlg, IDC_EDIT1, szBuffer);
                            sprintf(szBuffer, "%i", CheckPos.y);
                            SetDlgItemTextA(hDlg, IDC_EDIT2, szBuffer);
                    }
                    if(GetAsyncKeyState(VK_MENU) == -32767) //Bot toggle hotkey
                    {
                            ToggleBot(hDlg);
                    }
                    Sleep(10);
            }
    }

    /*
    ------------------------------------
    Main form message callback function.
    ------------------------------------
    */
    BOOL CALLBACK EventHandler(HWND hDlg, UINT uMsg, WPARAM wParam, LPARAM lParam)
    {
            switch(uMsg)
            {
                    case WM_SHOWWINDOW:

                            //Create the threads
                            CreateThread(NULL, 0,(LPTHREAD_START_ROUTINE)Hotkeys, hDlg, 0, NULL);
                            CreateThread(NULL, 0,(LPTHREAD_START_ROUTINE)Bot, hDlg, 0, NULL);
                            break;

                    case WM_DESTROY:
                            //PostQuitMessage(0);
                            break;
                    case WM_COMMAND:
                            if(HIWORD(wParam) == BN_CLICKED && LOWORD(wParam) == IDC_BUTTON1)
                            {
                                    ToggleBot(hDlg);
                            }
                            break;
            }
            return 0;
    }

    /*
    ------------------------------------
    Main form creation thread
    ------------------------------------
    */
    DWORD WINAPI StartUp(HINSTANCE hInstance)
    {
            //Create the main form
            DialogBox(hInstance, MAKEINTRESOURCE(IDD_DIALOG1), NULL, (DLGPROC)EventHandler);
            ExitThread(0);
            return 0;
    }

    /*
    ------------------------------------
    Entry point for win32 applications
    ------------------------------------
    */
    int CALLBACK WinMain(HINSTANCE hInstance, HINSTANCE hPrevInstance, LPSTR lpCmdLine, int nCmdShow)
    {
            MSG msg;
            if (hPrevInstance == NULL)
        {
                    //Create form startup thread
                    CreateThread(NULL, 0,(LPTHREAD_START_ROUTINE)StartUp, hInstance, 0, NULL);

                    //Translate and dispatch all incoming messages
                    while (GetMessage(&msg,NULL,0,0))
                    {
                            TranslateMessage(&msg);
                            DispatchMessage(&msg);
                    }
                    return msg.wParam;
            }
    }
